import Container from 'react-bootstrap/Container';
import Button from 'react-bootstrap/Button';

function NavMenu() {
  return (
    <Container className="d-flex justify-content-center gap-4 py-3">
      <Button variant="outline-success" size="lg" className="px-5 py-3">
        Coding
      </Button>
      <Button variant="outline-info" size="lg" className="px-5 py-3">
        Comics
      </Button>
    </Container>
  );
}

export default NavMenu;
